import React from "react";
import logo from "../assest/logo.png";

function Headers() {
  // <div className="lg:flex md:block hidden lg:justify-start md:justify-end justify-center items-center lg:pl-[21rem] md:pl-6 pl-4 ">
  return (
    <div className="fixed shadow-md w-full h-26 bg-red-900">
      <div className="flex bg-cyan-200 items-center h-full">
        <div className="h-12">
          <img src={logo} className="h-full" />
        </div>
      </div>
    </div>
  );
}

export default Headers;
